/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';
import { ScreenHelmet, useNavigator } from '@karrotframe/navigator';
import React from 'react';
import Button from '../components/Button';

const headingStyle = css`
  width: 308px;
  height: 78px;
  font-family: Noto Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 24px;
  line-height: 39px;
`;

const textEmphasize = css`
  color: #ff7a00;
`;

const Home = () => {
  const { push } = useNavigator();
  const handleGameStart = () => {
    push(`/game`);
  };
  return (
    <div>
      <ScreenHelmet title="홈" />
      <span>서울 광진구</span>
      <h1 css={headingStyle}>
        <span css={textEmphasize}>로제엽떡살인마</span>님은 우리동네에
        <span css={textEmphasize}>384793위</span> 에요!
      </h1>
      <Button onClick={handleGameStart} text={시작하기}></Button>
    </div>
  );
};

export default Home;
